import { Fragment } from "react";
// import { Route } from "react-router-dom";
// import QuteDetail from "./QuteDetail";
import QuoteList from "../components/quotes/QuoteList";
const MY_QUTES = [
  { id: "q1", author: "hamad", text: "its a hard life" },
  { id: "q2", author: "mohammad", text: "its a hard life too" },
];
const AllQutes = () => {
  return (
    <Fragment>
      <h1>this is all qutes page</h1>;
      <QuoteList quotes={MY_QUTES}></QuoteList>
    </Fragment>
  );
};

export default AllQutes;
